import "./App.css";
import HomePage from "./pages/HomePage";
<BrowserRouter>
<Routes>
  <Route path="/" elements={<HomePage />}></Route>
</Routes>
</BrowserRouter>

function App() {
  return (
    <div>
      <HomePage />
    </div>
  );
}

export default App;
